import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Provider } from 'react-redux';
import { store } from './store';

// Import pages
import HomePage from './pages/HomePage';
import DashboardPage from './pages/DashboardPage';
import ChallengePage from './pages/ChallengePage';
import IndividualChallengePage from './pages/IndividualChallengePage';
import LeaderboardPage from './pages/LeaderboardPage';
import ProfilePage from './pages/ProfilePage';

// Import components
import { AuthGuard, ProtectedRoute } from './components/auth';
import { ErrorBoundary } from './components/common';
import { DashboardProvider } from './components/dashboard';

// Import styles
import './styles/globals.css';

function App() {
  return (
    <Provider store={store}>
      <ErrorBoundary>
        <Router>
          <div className="App">
            <Routes>
              {/* Public routes */}
              <Route path="/" element={<HomePage />} />
              <Route path="/login" element={<AuthGuard />} />
              <Route path="/register" element={<AuthGuard />} />

              {/* Protected routes */}
              <Route path="/dashboard" element={
                <ProtectedRoute>
                  <DashboardProvider>
                    <DashboardPage />
                  </DashboardProvider>
                </ProtectedRoute>
              } />

              {/* Challenge routes */}
              <Route path="/challenges" element={
                <ProtectedRoute>
                  <ChallengePage />
                </ProtectedRoute>
              } />

              {/* Individual challenge routes */}
              <Route path="/challenge/:challengeId" element={
                <ProtectedRoute>
                  <DashboardProvider>
                    <IndividualChallengePage />
                  </DashboardProvider>
                </ProtectedRoute>
              } />

              {/* Specific challenge routes for direct access */}
              <Route path="/challenge1" element={
                <ProtectedRoute>
                  <DashboardProvider>
                    <IndividualChallengePage />
                  </DashboardProvider>
                </ProtectedRoute>
              } />

              <Route path="/challenge2" element={
                <ProtectedRoute>
                  <DashboardProvider>
                    <IndividualChallengePage />
                  </DashboardProvider>
                </ProtectedRoute>
              } />

              {/* Other routes */}
              <Route path="/leaderboard" element={
                <ProtectedRoute>
                  <LeaderboardPage />
                </ProtectedRoute>
              } />

              <Route path="/profile" element={
                <ProtectedRoute>
                  <ProfilePage />
                </ProtectedRoute>
              } />

              {/* Redirect unknown routes */}
              <Route path="*" element={<Navigate to="/dashboard" replace />} />
            </Routes>
          </div>
        </Router>
      </ErrorBoundary>
    </Provider>
  );
}

export default App;
